import React from 'react';

function App() {
  return (
    <div>
      <button>Mint Token</button>
      <button>Sell an Item</button>
      <button>List all items for sale</button>
      <button>Change price of an item</button>
      <button>Display minted address</button>

    </div>
  );
}

export default App;
